import React from "react";
import { Route, Switch } from "react-router-dom";
import index from "./Layout/index";

function App() {
    return (
        <div className="app-routes">
            <Switch>
                <Route path="/">
                    <index />
                </Route>
            </Switch>
        </div>
    );
}

export default App;
